	// Initialize the regexp
	re := regexp.MustCompile(`\{[^}]+\}`)

	// Find all the placeholders
	placeholders := re.FindAllString(log, -1)

	// Initialize the template string
	template := log

	// Iterate through the placeholders
	for _, placeholder := range placeholders {
		// Replace the placeholder with a placeholder template
		template = strings.ReplaceAll(template, placeholder, "{placeholder}")
	}

	// Return the log template
	return template
