vector<string> split(const string &s, char delimiter) {
    vector<string> tokens;
    string token;
    istringstream tokenStream(s);
    while (getline(tokenStream, token, delimiter)) {
        tokens.push_back(token);
    }
    return tokens;
}

string replace_placeholders(const string &log_message, const map<string, string> &placeholders) {
    string result = log_message;
    for (const auto &placeholder : placeholders) {
        regex pattern(placeholder.first);
        result = regex_replace(result, pattern, placeholder.second);
    }
    return result;
}

