function getLogTemplate(logMessage) {
    let regex = /\d+|\w+/g;
    let match = logMessage.match(regex);
    let placeholders = {};
    let template = logMessage;
    for (let i = 0; i < match.length; i++) {
        let word = match[i];
        if (i % 2 === 0) {
            placeholders[word] = `{${word}}`;
        } else {
            template = template.replace(word, placeholders[match[i - 1]]);
        }
    }
    return template;
}

